// 入口文件
import React from "react";  // es6 import 全面使用es6
import ReactDOM from "react-dom";
import "./styles.css";  //css global.css

// react 语法  小程序

function App() {
    return (
        <div className="App">
            App
        </div>
    )
}

const rootElement = document.getElementById('root')
ReactDOM.render(<App/>,rootElement);
